import com.greensock.TweenMax;
import flash.display.MovieClip;

var particleLayer:MovieClip;

init();

function init ():void {
	particleLayer = MovieClip(parent).particleLayer;
	gotoAndStop(1 + Math.ceil(Math.random()*this.totalFrames));
	alpha = 1;

	TweenMax.to(this, 20, {alpha:0, useFrames:true, onComplete:kill});
}

function update ():void {
	/*
	if (alpha > 0) {
		alpha -= .05;
	} else {
		particleLayer.removeFromLightningAura(this);
		MovieClip(parent).removeChild(this);
	}
	*/
}

function kill ():void {
	particleLayer.removeFromLightningAura(this);
	MovieClip(parent).removeChild(this);
}
